    "reprPoint" : [ 39.254685, 14.329528 ],
    "description" : "The local tradition narrates that King Bazen, on the 10th year of his reign renewed the place which had been a site of religious veneration (Orit). The Queen of Sheba slept at this place during her trip (hence, the etymology of word Aḥzära;but it is unclear if it is a Tǝgrǝñña or Gǝʿǝz word); because of this, a temple was established here. Aḥmäd Graññ is said to have closely come to Aḥzära, but was chased away by a strong wind."
