    "provenance" : "Encyclopedia Aethiopica",
    "place_types" : [ "church", "monastery", " Postaksumite II" ],
    "details" : "The monastery Dabra Dāmmo is one of the oldest Ethiopian monasteries, which is located on top of the mountain plateau (Dabra Dāmmo) entirely surrounded by steep cliffs in the district of Bizät. The monastery seems to have been favored by the Aksumites kings, but neglecetd in the Zāgʷe period, for it was at the forefront of the anti- Zāgʷe struggle. Dabra Dāmmo enjoyed a high reputation as a traditional church educational institution, where several prominent religious missionaries and monastic leaders have been trained, including ʾIyasus Moʾa ʾIyasus Moʾa and Takla Hāymānot Takla Hāymānot. It played a pivotal role in the expansion of Christianity in its early years and was also a center of learning and manuscript production. Following the foundation of other monasteries like Dabra Ḥayq ʾƎsṭifānos and Dabra Libānos, it was no more the pre-dominant monastery, yet it was important in the Christian Highland until it was looted and destructed by the Ottoman Turkish forces in 1557.",
