    "place_types" : "church",
    "details" : "After its foundation by ʾǝtege Bǝrhān Mogasā, Dabra Ḍaḥay Qʷǝsqʷām became one of the most important churches of Gondar. However, it was sacked by ʾaṣe Tewodros II in 1866. He removed many of its manuscripts that ended up in the No item: INS0001BL. The church was sacked even further by the Mahdists in the 1880s and seriously damaged by air strikes in 1941. Although it was recently restored, it lost its past glory.",
