    "place_types" : "monastery",
    "details" : "The main church established by ʾabuna Yāsāy seems to have survived most invasions undamaged and, according to the tradition, in the 1500 - 1599, ʾAḥmad was chased away from the monastery by archangels Gabriel and Michael. In the 1600 - 1699 the church was renovated by ʾaṣe Fāsiladas. This monastery was an important centre of learning and played a significant role in the religious disputes between Tawāḥǝdo and Qǝbāt teaching. Mandābbā Madḫāne ʿĀlam was not affected by the Mahdist invasions in the 1800 - 1899. In the 1900 - 1999, Mǝnilǝk and empress Zawditu donated books to the library of the monastery, while Ḫaylä Śǝllase I provided for an extensive renovation of the old church and ǝtege Mänän Asfaw financed an adjoining church for women. The church survived the Darg period fairly well.",
