    "place_types" : "monastery",
    "details" : "During the 1400 - 1499, the monastic life expanded at Dāgā ʾƎsṭifānos and the monastery benefitted from land grants, royal burials and artistic realizations. During the 1550 - 1599, the monastery was still used as a mausoleum for the members of the royal family and seems to have been very prosperous. 1563 - 1574, mamhǝr Gabra Krǝstos restored the church with the support of kantibā Gäbrä Mikaʾel . The monastery supported ʾaṣe Śarḍa Dǝngǝl in the wars against the Muslims and, in turn, received lands in Däq. At the end of 1646, ʾaṣe Fāsiladas gave the monastery lands in Dǝrdǝrā and, later, in Zǝbǝd. In 1646, he also decided to rebuild the church, which was completed 1651 - 1653. However, the church burnt down again in 1714. Following the foundation of Nārgā Śǝllāse by Bǝrhān Mogasā, some of the lands traditionally attributed to Dāgā ʾƎsṭifānos were given to the new monastery, causing conflicts. The church was burnt down again in approx. 1880 and reconstructed with the present octagonal building.",
