    "place_types" : "monastery",
    "details" : "The development of Dabra Ḥayq ʾƎsṭifānos began with the arrival of ʾIyasus Moʾa to the island in approx. 1248. He offered his support to ʾaṣe Yǝkunno ʾAmlāk to seize the throne of the Zagwe . The monastery became very close to the Ethiopian rulers and was richly endowed with lands. Dabra Ḥayq ʾƎsṭifānos was destroyed and looted by ʾAḥmad in 1532. However the monastery continued to be an important religious centre throughout the 1800 - 1899 and 1900 - 1999 and has been famous for its rich library.",
