    "description" : "According to Gadla ʾIyasus Moʾa there were two churches founded on the monastery's site. One was built around the 0900 - 0999 by ʾaṣe Dǝlnāʿod and ʾabuna Sälama “Zäʾazeb” and dedicated to God the Father. The other one was founded in 0862 (or 1167 according to Enrico Cerulli's chronology), consecrated by Metropolitan Bǝnyam and dedicated to Saint St Stephen. However, Gadla ʾIyasus Moʾa are very incoherent and their goal seems rather to be to place the monastery's foundation before the Zagwe dynasty."
