    "provenance" : "Encyclopedia Aethiopica",
    "place_types" : [ "monastery", " Postaksumite II" ],
    "details" : "Dabra Libānos, originally known as Dabra ʿAsbo and renamed by ʾaṣe Zarʾa Yāʿqob is a monastery located in Šawā in the gorge near the river Zega Wädäb. This southern location has to be emphasized: the community was established between the pagan kingdom of Dāmot and the Muslim sultanate of Šawā under the authority of ʾIfāt. According to the hagiography of ʾAnorewos, one of the first disciples of ʾabuna Takla Hāymānot, the daily life was under the jurisdiction of the maggābi. It is known that the monastery enjoyed land donations at least since the half which one? of 15th century during the reign of ʾaṣe Zarʾa Yāʿqob. The monastery of Dabra Libānos suffered great destruction during the war of ʾAḥmad in 1532. However, it revived soon under ʾaṣe Galāwdewos and his successor Śarḍa Dǝngǝl during which attempts were made to elevate the monastery to the position of religious centre of the monarchy. But the situation deteriorated due to the massive expansion of the Oromo and increasing isolation of Dabra Libānos from the rest of the Empire.",
